import ReactDOM from 'react-dom/client';

const product = 'MacBook';
const model = 'Air';
const item = product + ' ' + model;
const imageUrl = 'https://avatars.githubusercontent.com/u/92559412?v=4';

function handleClick() {
  alert('곧 도착합니다!');
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <h1>나만의 {item.toUpperCase()} 주문하기</h1>
    <img src={imageUrl} alt="제품사진" />
    <button>확인</button>

    <h1 id="title">가위바위보</h1>
    <button className="hand">가위</button>
    <button className="hand">바위</button>
    <button className="hand">보</button>
  </>

);
